local bit = require('coro-http-luv.secure-socket.bit')

--
-- Base64 decoding adapted from: https://github.com/philanc/plc/blob/master/plc/base64.lua
-- Copyright (c) 2015  Phil Leblanc, MIT License
--

local char, byte, concat = string.char, string.byte, table.concat
local B64CHARS = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/"
local b64charmap = {};
for i = 1, 64 do b64charmap[byte(B64CHARS, i)] = i - 1 end

-- decode base64-encoded string
-- ignore all whitespaces, newlines, and padding ('=') in b
local function unbase64(b)
  local cmap = b64charmap
  local e1, e2, e3, e4
  local st, t3 = {}, {}
  b = string.gsub(b, "%-", "+")
  b = string.gsub(b, "_", "/")
  b = string.gsub(b, "[=%s]", "") -- remove all whitespaces and '='
  if b:find("[^0-9A-Za-z/+=]") then return nil, "invalid char" end
  for i = 1, #b, 4 do
    e1, e2 = cmap[byte(b, i)], cmap[byte(b, i+1)]
    if not e1 or not e2 then return nil, "invalid length" end
    e3, e4 = cmap[byte(b, i+2)], cmap[byte(b, i+3)]
    t3[1] = char(bit.bor(bit.lshift(e1, 2), bit.rshift(e2, 4)))
    if not e3 then
      t3[2], t3[3] = nil, nil
      st[#st + 1] = concat(t3)
      break
    end
    t3[2] = char(bit.band(bit.bor(bit.lshift(e2, 4), bit.rshift(e3, 2)), 0xff))
    if not e4 then
      t3[3] = nil
      st[#st + 1] = concat(t3)
      break
    end
    t3[3] = char(bit.band(bit.bor(bit.lshift(e3, 6), e4), 0xff))
    st[#st + 1] = concat(t3)
  end
  return concat(st)
end

return unbase64("")
